window.bookSummaryJSON = "<p><b>Full pirate mode. Dungeons to explore. A quest to gather the eight skulls! </b></p> <p>Drew has finally got it all together. First, there is his pocket dimension, a quickly growing area based around his good buddy, Tree. Then there are his students, six random kids he...liberated. Finally, there is the dragon stalking him.&nbsp;</p> <p>Cultivating, sailing, staying ahead of trouble. That’s his plan as he moves into the creation of his solid Core. Seducing a dragon was a total accident. Nuking an Island? Let’s not focus on the details. They started it.&nbsp;</p> <p>What’s the best thing to do while getting his magical career and development back on track? Play pirate, of course!</p>"; 
